INSERT INTO `doc_extra` VALUES (426, 11303, '{\"data\":{\"info\":{\"doc_id\":11303,\"update_time\":1617971574,\"interface_status\":1,\"interface_conf\":\"{\\n  \\\"logInterface\\\": true,\\n  \\\"list\\\": [{\\n    \\\"time\\\": \\\"2020/11/05\\\",\\n    \\\"text\\\": [\\\"[小程序] 新增接口：快速跳转到添加客户的界面 wx.qy.navigateToAddCustomer。\\\", \\\"[小程序] 新增接口：变更群成员接口 wx.qy.updateEnterpriseChat，可往指定客户群添加成员\\\", \\\"[小程序] 变更接口：wx.qy.openEnterpriseChat，可返回chatId，且支持按指定chatid打开已有的客户群。\\\", \\\"[小程序] 变更接口：wx.qy.getContext 支持家校应用调用。\\\", \\\"[小程序] 变更接口：wx.qy.getCurExternalChat 支持家校应用调用。\\\", \\\"[小程序] 变更接口：wx.qy.sendChatMessage 支持家校应用调用。\\\", \\\"[JS-SDK] 新增接口：快速跳转到添加客户的界面 navigateToAddCustomer。\\\", \\\"[JS-SDK] 新增接口：变更群成员接口updateEnterpriseChat，可往指定客户群添加成员。\\\", \\\"[JS-SDK] 新增接口：跳转到小程序接口launchMiniprogram。\\\", \\\"[JS-SDK] 变更接口：openEnterpriseChat，可返回chatId，且支持按指定chatid打开已有的会话。\\\", \\\"[JS-SDK] 变更接口：getContext 支持家校应用调用。\\\", \\\"[JS-SDK] 变更接口：getCurExternalChat 支持家校应用调用。\\\", \\\"[JS-SDK] 变更接口：sendChatMessage 支持家校应用调用。\\\", \\\"[服务端API] 新增接口：互联企业应用相关接口，应用可获取可见范围内其他互联企业的通讯录。\\\", \\\"[服务端API] 变更接口：第三方服务商获取企业永久授权码，无论企业是否新注册，通过扫推广二维码安装的，都返回注册码相关信息。\\\"]\\n  }, {\\n    \\\"time\\\": \\\"2020/09/27\\\",\\n    \\\"text\\\": [\\\"[服务端API] 获取客户群统计数据接口，添加支持一次性拉取多个自然日的数据。\\\", \\\"[服务端API] 新增接口：获取客户群统计数据并按自然日聚合。\\\"]\\n  }, {\\n    \\\"time\\\": \\\"2020/09/21\\\",\\n    \\\"text\\\": [\\\"[服务端API] 新增“批量获取客户详情”，可根据成员userid批量获取客户的详情。\\\"]\\n  }, {\\n    \\\"time\\\": \\\"2020/09/18\\\",\\n    \\\"text\\\": [\\\"[服务端API] 原“离职成员的外部联系人再分配”接口，调整为支持在职成员的客户分配。\\\"]\\n  }, {\\n    \\\"time\\\": \\\"2020/09/14\\\",\\n    \\\"text\\\": [\\\"[服务端API] 新增“微盘接口”，企业可以通过微盘相关接口，对微盘的文件进行操作和设置权限。\\\"]\\n  }],\\n  \\\"listNew\\\": [{\\n    \\\"time\\\": \\\"2021/04/02\\\",\\n    \\\"content\\\": [{\\n      \\\"feat\\\": \\\"会话\\\",\\n      \\\"abs\\\": \\\"\\\",\\n      \\\"moudule\\\": [{\\n        \\\"title\\\": \\\"\\\",\\n        \\\"jssdk\\\": [{\\n          \\\"type\\\": 1,\\n          \\\"text\\\": \\\"应用可隐